script: |
  super -f text -I q7187.spq | sort > q7187.out

inputs:
  - name: q7187.spq
    data: |
      SELECT ALL col1 AS col2 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - ( + - col1 ) BETWEEN + 69 * + + col0 - + ( + - col1 ) AND - col0 + - CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q7187.out
    data: |
      51
      67
      77
